import React from 'react';

const FacultyDashboard = () => {
  return (
    <div className="p-4">
      <h2>Welcome to the Faculty Dashboard</h2>
      <p>Here you can manage your courses, bookings, and view reports.</p>
    </div>
  );
};

export default FacultyDashboard;
